description:
Brazil: Saving the Tamarin

Nature Documentary hosted by Jeff Corwin, published by Discovery Channel broadcasted as part of DC The Jeff Corwin Experience series in 2003 - English narration


Information
------------------------------

Corwin travels to Manaus, Brazil, to help capture and relocate a colony of tamarins.

